import React, { useState } from "react";
import Help from "../components/Help";

function Steaguri() {
  const [raspuns, setRaspuns] = useState("");

  const src = {
    p: require("../img/sapdajfpidagofgbj.png").default,
    i: require("../img/lsaklkdbakgjfgblifkgjhdf.png").default,
    s: require("../img/kjbdsfkjsdbfkjdsbkfjsdbf.png").default,
    c: require("../img/lsadmsaldlsa.png").default,
    a: require("../img/asoidhsaod.png").default,
    l: require("../img/saldnslakdnsalkndlk.png").default,
    e: require("../img/fhgfgfjdhfgsdjf.png").default,
    r: require("../img/yusagdusaygd.png").default,
    g: require("../img/ksjadbkasjdk.png").default,
    n: require("../img/dkjfbsdkbfjkdsbfkj.png").default,
  };

  function containsOnly(array1, array2) {
    return array2.every((elem) => array1.includes(elem));
  }

  const submit = () => {
    const ras = raspuns.toString().trim().toLowerCase().replace(" ", ".");
    if (
      containsOnly(ras, ["pisica", "alearga", "cainele", " "]) ||
      containsOnly(ras, ["pisica", "alearga", "cainele"])
    ) {
      console.log("da");
    } else {
      console.log("nu");
    }
  };

  return (
    <>
      <div
        className="fullPage"
        style={{
          display: "flex",
          justifyContent: "space-evenly",
          flexDirection: "column",
          padding: "0 100px",
        }}
      >
        <div className="cerinta">
          Decodati acest mesaj secret si scrieti rezultatul
        </div>
        <div className="mesaj">
          <div className="p">
            <img src={src.p} alt="" />
            <img src={src.i} alt="" />
            <img src={src.s} alt="" />
            <img src={src.i} alt="" />
            <img src={src.c} alt="" />
            <img src={src.a} alt="" />
          </div>
          <div className="p">
            <img src={src.a} alt="" />
            <img src={src.l} alt="" />
            <img src={src.e} alt="" />
            <img src={src.a} alt="" />
            <img src={src.r} alt="" />
            <img src={src.g} alt="" />
            <img src={src.a} alt="" />
          </div>
          <div className="p">
            <img src={src.c} alt="" />
            <img src={src.a} alt="" />
            <img src={src.i} alt="" />
            <img src={src.n} alt="" />
            <img src={src.e} alt="" />
            <img src={src.l} alt="" />
            <img src={src.p} alt="" />
          </div>
        </div>
        <div className="rasp">
          <input
            type="text"
            placeholder="Scrie raspunsul tau"
            onChange={(e) => {
              setRaspuns(e.target.value);
            }}
          />
          <button type="submit" onClick={submit}>
            Submit
          </button>
        </div>
        <div className="rez">{}</div>
      </div>
      <Help text="lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem lorem " />
    </>
  );
}

export default Steaguri;
